import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Papildymas from './components/papildymas';
import { Icon } from '@iconify/react';

function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/register" element={<Register />}></Route>
      <Route path="/" element={<Main />}></Route>
      <Route path="/login" element={<Login />}></Route>
    </Routes>
  </BrowserRouter>
      <section className='main'>
          <article className='main-content'>
            <a href="/papildymas.html" className="main-link"><button className='main-button'><Icon icon="uil:money-insert" className='main-icon'/>Papildyti sąskaitą</button></a>
            <a href="/isvedimas.html" className="main-link"> <button className='main-button'><Icon icon="solar:cash-out-broken" className='main-icon'/>Išvesti pinigus</button></a>
            <a href="/pervedimas.html" className="main-link"><button className='main-button'><Icon icon="fa6-solid:money-bill-transfer" className='main-icon'/>Pervesti pinigus į kitą sąskaitą</button></a>
        </article>
      </section>

</>

  );
}

export default App;
